def corpus_specific_text_cleaning(text):
    text = text.replace("/", " / ")
    text = text.replace("#", " # ")
    text = text.replace("!", " ! ")
    

    return text
    
CLEANING_METHOD = corpus_specific_text_cleaning


def get_annotation(doc_path):
    doc_id = os.path.split(doc_path)[-1].replace(".txt", "")
    annotated = annotation_dict[int(doc_id)]
    return_list = []
    for nr, switch in enumerate(annotated):
        if switch == '1':
            return_list.append(labels[nr])
    return return_list

ADDITIONAL_LABELS_METHOD = get_annotation

